import React, {Component} from 'react'

class tM extends Component{
    render(){
        return (
            <div>
                <RWD window>
                    <div rwd={ { max: 600 } }>small</div>
                    <div rwd={ { max: 1024 } }>tablet</div>
                    <div rwd={ { max: 1280 } }>small desktop</div>
                    <div>Defalt</div>
                </RWD>
        </div>
        )}}
export default tM;
